class Solution:
	def smallestRange(self, nums):
		indexlist = [0 for _ in nums]
		lenlist = [len(i) for i in nums]
		heap = minheap()
		curmax = 0
		curmin = - 2**30
		for i in range(len(indexlist)):
			if curmax<nums[i][indexlist[i]]:
				curmax=nums[i][indexlist[i]]
			if curmin>nums[i][indexlist[i]]:
				curmin=nums[i][indexlist[i]]
			heap.insert(nums[i][indexlist[i]],i)
		minrange = curmax-curmin
		res = [curmin,curmax]
		while True:
			minvalue,row = heap.delMin()
			r = curmax - minvalue
			if r < minrange:
				minrange = r
				res = [minvalue,curmax]
			if indexlist[row]==lenlist[row]-1:
				break
			indexlist[row]+=1
			heap.insert(nums[row][indexlist[row]],row)
			if curmax<nums[row][indexlist[row]]:
				curmax=nums[row][indexlist[row]]
		return res

class minheap:
	def __init__(self):
		self.heap = [1234]
		self.heapindex = [1234]

	def insert(self,num,row):
		if len(self.heap)==1:
			self.heap.append(num)
			self.heapindex.append(row)
			return
		self.heap.append(num)
		self.heapindex.append(row)
		l = len(self.heap) - 1
		while self.heap[l//2]>self.heap[l] and l!=1:
			t = self.heap[l//2]
			ti = self.heapindex[l//2]
			self.heap[l//2] = self.heap[l]
			self.heapindex[l//2] = self.heapindex[l]
			self.heap[l] = t
			self.heapindex[l] = ti
			l = l//2

	def delMin(self):
		res = self.heap[1]
		row = self.heapindex[1]
		self.heap[1] = self.heap[-1]
		self.heapindex[1] = self.heapindex[-1]
		self.heap.pop()
		self.heapindex.pop()
		l = 1
		while 2*l<len(self.heap):
			if l*2+1<len(self.heap):
				if not(self.heap[l]>self.heap[l*2+1] or self.heap[l]>self.heap[l*2]):
					break
				if self.heap[l*2]<self.heap[l*2+1]:
					swap = 2*l
				else:
					swap = 2*l+1
			else:
				if not self.heap[l]>self.heap[l*2]:
					break
				swap = 2*l


			t = self.heap[swap]
			self.heap[swap] = self.heap[l]
			self.heap[l] = t
			ti = self.heapindex[swap]
			self.heapindex[swap] = self.heapindex[l]
			self.heapindex[l] = ti
			l = swap
		return res,row		
	def show(self):
		print(self.heap)

